import { Component, Prop, Vue } from 'vue-property-decorator';
import Tabs from './tabs.vue';
import AppButton from './button.vue';

@Component({
  components: {
    Tabs,
    AppButton
  }
})
export default class TitleBar extends Vue {
  @Prop() title: string;
  @Prop() links: Object[];
  @Prop() routeBack: string;
  @Prop() btnBackLabel: string;
}
